import React, { Component } from 'react'
import Header from '../components/Header.js'
import toast from '../assets/toast.png'

class Home extends Component{
  render(){
    return(
      <React.Fragment>
        <Header />
        <div>
          <img src={ toast } alt="Close up of a cat nose" id="toast"/> 
        </div>
      </React.Fragment>
    )
  }
}
export default Home
